    public static String toString(long mask) {
        var string = "+---+---+---+---+---+---+---+---+\n";
        int rowCount = 0;
        var colour = " ";
        for (int rank = 7; rank >= 0; rank--) {
            for (int file = 0; file < 8; file++) {
                if ((mask & setLocationMasks[rank * 8 + file]) != 0) {
                    string += String.format("|[%s]", colour);
                } else {
                    string += String.format("| %s ", colour);
                }
                rowCount++;
                if (rowCount == 8) {
                    rowCount = 0;
                    string += "|\n+---+---+---+---+---+---+---+---+\n";
                } else {
                    if (colour == " ") {
                        colour = ".";
                    } else {
                        colour = " ";
                    }
                }
            }
        }

        return string;
    }

